// Class methods

mdl_male_bones::mdl_male_bones(void) : m_male_BonW(N_VERTS_3, std::vector<double>(N_BONES, 0))
{
    // BonW
    for (unsigned int i = 0; i < N_VERTS_3; ++i) {
        for (unsigned int j = 0; j < N_BONES; ++j) {
            m_male_BonW[i][j] = c_male_bone_weights[i][j];
        }
    }
}

std::vector< std::vector<double> > &mdl_male_bones::getBonW(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_male_BonW);
}

